import React,{Component} from 'react';
class Landingcontent extends React.Component{
	constructor(props){
		super(props)

	}
	render(){
		return(
			<div>
			<div className="main1">
				<div className="c1">
					
				</div>
				<div className="c2">
				</div>

				<div className="c3">

				</div>


			</div>

						<div  className="footer">
			<p> Copyright 2020 Â© Cyber Intelligence House</p>
			</div>
			<style jsx>{`
					.footer{
					  position: fixed;
					  left: 0;
					  bottom: 0;
					  width: 100%;
					  
					  color: gray;
					  text-align: center;
			}
				.main1{

					display:flex;
					flex-direction:row;
					height:500px;
					margin-top:80px;
					align-items:center;
					justify-content:space-around;
					flex-wrap: wrap;
					


				}
				.c1{
					display:flex;
					margin-top:60px;
					background:white;
					height:350px;
					width:350px;
					 border: 0.5px solid #dddfe6;;
					 box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
					
				}
				.c2{
					display:flex;
					width:350px;
					background:white;
					height:350px;
					 margin-top:60px;
					 border: 0.5px solid #dddfe6;;
					 box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
					
				}
				.c3{
					display:flex;
					width:350px;
					background:white;
					height:350px;
					 margin-top:60px;
					 border: 0.5px solid #dddfe6;;
					 box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
				}
				 @media (max-width: 1044px) {
				    .footer {
				          position: relative;
						  left: 0;
						  bottom: -200;
						  width: 100%;
						  text-align: center;
				        
				    }
				    .main1{
				    display:flex;
					flex-direction:row;
					height:1500px;
					margin-top:80px;
					align-items:center;
					justify-content:space-around;
					flex-wrap: wrap;
					
				    }

}
				`}</style>

			</div>

		)
	}
}
export default Landingcontent
